import React, { Component } from "react";
import { Autocomplete } from "@mui/material";
export default class QuanLyNguoiDung extends Component {
  render() {
    return (
      <div>
        <Autocomplete
          disablePortal
          id="combo-box-demo"
          sx={{ width: 300 }}
          renderInput={(params) => <TextField label="Movie" />}
        />
      </div>
    );
  }
}
